import { initializeApp } from "firebase/app";
import firebaseConfig from "./firebase.config";
import {
    getAuth,
    signInWithPopup,
    GoogleAuthProvider,
    signOut,
    createUserWithEmailAndPassword,
    signInWithEmailAndPassword,
    updateProfile,
  } from "firebase/auth";

export const initializeLoginFrame = () => {
    initializeApp(firebaseConfig);
};
